import React from "react";
import "./Join.css";

//Get Code from user and verify
//Get Username from User
//dropdown for colors
function Join() {
  return (
    <main>
      <h1>Join Lobby</h1>
      <div id="codeContainer">
        <form>
          <input type="Number" placeholder="Enter Lobby Code" />
        </form>
        <button id="enterGameBtn" type="submit">
          Enter Game
        </button>
      </div>
    </main>
  );
}

export default Join;
